column6:
I'm a startup sales leader with proven success taking early-stage products to market, structuring innovative partnerships and empowering ambitious sales professionals. My goal is to consistently overachieve on customer, peer and investor expectations.

 I lead the sales organization at Zagster, the fastest growing startup in the bike share industry. Zagster's mission is to make the bicycle the most loved form of transportation. Our full-service bike sharing solutions meet business, community and civic goals for organizations of all kinds, including:

 Municipalities, like the City of Albuquerque and City of Carmel;
 Corporations, like General Motors, Samsung, Workday, Quicken Loans;
 Universities, like Duke, Yale, Princeton, Ohio State;
 Developers, like Related, Kayne Anderson, EdR, The Irvine Company

 We have lots of ground to cover! Don't hesitate to get in touch.
